import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { useEffect } from 'react';
import Login from './pages/Login';
import Home from './pages/Home';
import AdminDashboard from './pages/AdminDashboard';
import FacultyDashboard from './pages/FacultyDashboard';
import StudentDashboard from './pages/StudentDashboard';
import About from './pages/About';
import Contact from './pages/Contact';

// Import Bootstrap and custom styles
import './App.css';
import './styles/customStyles.css';
import './styles/globals.css';

// Import AOS (Animate On Scroll)
import AOS from 'aos';
import 'aos/dist/aos.css';

// Font Awesome setup
import { library } from '@fortawesome/fontawesome-svg-core';
import { fab } from '@fortawesome/free-brands-svg-icons';
import { 
  faCalendarAlt, faMapMarkerAlt, faUsers, faClock, 
  faGraduationCap, faTrophy, faMusic, faChalkboardTeacher,
  faEnvelope, faPhone, faHome, faInfoCircle, faList,
  faSignInAlt, faUserPlus, faPaperPlane, faChevronDown,
  faHandsHelping, faBullseye, faHandshake, faLightbulb,
  faMapMarkedAlt, faChevronRight
} from '@fortawesome/free-solid-svg-icons';

// Add icons to the library
library.add(
  fab, faCalendarAlt, faMapMarkerAlt, faUsers, faClock,
  faGraduationCap, faTrophy, faMusic, faChalkboardTeacher,
  faEnvelope, faPhone, faHome, faInfoCircle, faList,
  faSignInAlt, faUserPlus, faPaperPlane, faChevronDown,
  faHandsHelping, faBullseye, faHandshake, faLightbulb,
  faMapMarkedAlt, faChevronRight
);

function App() {
  // Initialize AOS on component mount
  useEffect(() => {
    AOS.init({
      duration: 800,
      easing: 'ease-in-out',
      once: true,
      mirror: false
    });
  }, []);

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/faculty-dashboard" element={<FacultyDashboard />} />
        {/* Add extra route to support session IDs in URL */}
        <Route path="/faculty-dashboard/:sessionId" element={<FacultyDashboard />} />
        <Route path="/student-dashboard" element={<StudentDashboard />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
